import { useState } from 'react'

export default function CsvReader(){
    const [csvFile, setCsvFile] = useState();
    
    const submit = () => {
        const file = csvFile;
        const reader = new FileReader();

        reader.onload = function(e) {
            const text = e.target.result;
            console.log(text);
        }

        reader.readAsText(file);
    }

    return(
        <form id='csv-form'>
            <input
                type='file'
                accept='.csv'
                id='csvFile'
                file = '/data.csv'
            >
            </input>
            <br/>
            {submit()}
        </form>
    );

}
